import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Homepage from './Homepage';
import Login from './Login';
import Signup from './Signup';
import Header from './Header';
import Medicines from './Medicines';
import Test from './Test';
import Details from './Details';
import Box from './Box';
import Cart from './Cart';
import Cartdeets from './Cartdeets';
import Consult from './Consult';
import Cancer from './Cancer';
import Lab from './Lab';
import AboutUs from './AboutUs';
import SearchResults from './SearchResults';
import AddMembership from './MembershipOptions.js'; // Add Membership page
import AddAddress from './AddAddress'; // Add Address page
import Checkout from './Checkout'; // Proceed to Payment page

function App() {
  // Sample data for cartDetails and userId to pass to the new components
  const userId = 'user123'; // Replace this with dynamic user ID logic
  const cartDetails = [
    { itemName: 'Dolo 650 Tablet', price: 29 },
    { itemName: 'Cofsils', price: 29 },
  ]; // Sample cart details

  return (
    <div>
      <BrowserRouter>
        <Header />
        <Routes>
          <Route path="/Homepage" element={<Homepage />} />
          <Route path="/Login" element={<Login />} />
          <Route path="/Signup" element={<Signup />} />
          <Route path="/Medicines" element={<Medicines />} />
          <Route path="/Test" element={<Test />} />
          <Route path="/Details" element={<Details />} />
          <Route path="/Box" element={<Box />} />
          <Route path="/Cart" element={<Cart />} />
          <Route path="/Cartdeets" element={<Cartdeets />} />
          <Route path="/Consult" element={<Consult />} />
          <Route path="/Cancer" element={<Cancer />} />
          <Route path="/Lab" element={<Lab />} />
          <Route path="/aboutus" element={<AboutUs />} />
          <Route path="/search-results" element={<SearchResults />} />

          {/* New Routes */}
          <Route path="/add-membership" element={<AddMembership userId={userId} />} />
          <Route path="/add-address" element={<AddAddress userId={userId} />} />
          <Route path="/checkout" element={<Checkout userId={userId} cartDetails={cartDetails} />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
